import React from 'react';

import { withFirebase } from '../Firebase'

const SignOutButton = ({ firebase }) => (
  <button type="button" onClick={firebase.doSignOut.then(() => {console.log(hello)})}>
    Sign Out
  </button>
)

export default withFirebase(SignOutButton)
